Thupelo ena e u fa koetliso ea maemo a webo ea data le maemo a webo a semantic. O tla u tsebisa lipuo tse u lumellang:
- ho emela le ho phatlalatsa lintlha tse hokahaneng ho Websaete (RDF);
- ho botsa le ho khetha data ena ka nepo haholo u le hole le ka Web (SPARQL);
- emela mantsoe le ho beha mabaka le ho fumana lintlha tse ncha ho ntlafatsa litlhaloso tse hatisitsoeng (RDFS, OWL, SKOS);
- 'me qetellong, ho rera le ho latela histori ea data (VOiD, DCAT, PROV-O, joalo-joalo).
fomate
Thupelo ena e arotsoe ka libeke tse 7 + 1 bonase beke ka ho feletseng e nehetsoeng ho Dbpedia. Litaba li fumaneha ka botlalo ka mokhoa boitelo, ke hore, bula ka mokhoa oa nako e telele o u lumellang hore u hatele pele ka lebelo la hau. Tatelano eohle ea thupelo e hlahisa mehopolo ea thupelo e nang le litaba tse fapaneng tsa multimedia: livideo, lipotso, litemana le lihokelo tse ling + lipontšo tse ngata tse bonts'ang ts'ebeliso ea mekhoa e hlahisitsoeng. Qetellong ea beke e 'ngoe le e 'ngoe, ho fanoa ka boikoetliso le ho tebisa maikutlo.

Mask oa ho Buoa ka Bongaka
Li-mask tsa ho buoa tsa bongaka li na le khanyetso e nyane ea phallo ea moea, thibelo ea mali ea maiketsetso, ho sefa ha lintho tse itseng le libaktheria, ho thibela lelakabe le litšobotsi tse ling;e fanoe ka sebopeho sa nyopa.khanyetsano ea phallo ea moea e ka tlase ho 49 Pa, ts'ebetso ea ho sefa ea baktheria e kholo ho feta 95.
Sehlahisoa se loketse tšireletso ea motheo ea basebetsi ba tsa bongaka kapa basebetsi ba amanang le bona, hammoho le tšireletso khahlanong le
... 
le moea oa pro-monness permeability;
3.Sesefa sa mask se entsoe ka lesela le sa lohiloeng le qhibilihang ka mokhoa o hlakileng, 'me matla a ho sefa a baktheria a feta 95%;
4.Sekoahelo sa nko sa 'mele oa mask oa polasetiki nakong ea ho apara phetoho e loketseng, ho apara ho phutholoha le ho phutholoha;
5.Ho hanyetsa ho phefumoloha ho tlase ho 49 Pa, nakong ea ho apara;
6.Sehlahisoa sena se sebelisa theknoloji ea khatiso e se nang moeli le theknoloji ea welding ea ultrasonic ho etsa hore mask a be
...
oba ho kopana ka letsoho le kahare ea mask, lehlakore le ka tlase la mask ho isa motsong oa selelu, lebanta la tsebe le letšehali le lebanta le letona le leketlileng tsebeng;
3.U sebelisa polasetiki ea sekoaelo sa nko ea mask, tobetsa ka monoana, etsa hore sekotwana sa nko se khomarele ka holim'a sefate sa nko, u bōpe sekoahelo sa nko ho ea ka sebōpeho sa sefate sa nko, ebe u tsamaisa monoana oa letsoho mahlakoreng ka bobeli butle-butle, e le hore mask kaofela a be haufi le letlalo la sefahleho.
